  input: '"TEXT","F3XN","C00034033","1. The SCGOP is using the following best effort
    to obtain identification of all individuals who contribute in excess of $200.  Our
    original solicitation includes a clear and conspicuous request for this information
    which includes the requirements of the federal law to provide such information.  If
    the information is not provided, we make a follow up effort per phone.  If the
    needed information is still not provided, we search the internet to obtain the
    information.  2. The disbursements on Schedule H4 to Advanced Video for $ 3342.25
    and $ 2649.50, to Morganellis for $ 1456.50, and to Centerplate for $ 38065.92
    were for expenses in connection with our general annual fundraising event, which
    did not refer to a clearly identified candidate for Federal office, nor did it
    promote, support, attack, or oppose any candidate for Federal office.  3. The
    disbursements for Starboard of $ 25830 and $37671 were for direct mail for general
    fundraising efforts, which did not refer to a clearly identified candidate for
    Federal office, nor did it promote, support, attack, or oppose any candidate for
    Federal office.  4. The disbursements on Schedule B to Campaign Services for $
    3454.25 were for expenses for our membership material, which did not refer to
    a clearly identified candidate for Federal office, nor did it promote, support,
    attack, or oppose any candidate for Federal office.  5.  The contribution on line
    A 11 C from Walker for House should have been deposited into our State Account.
    We will transfer $ 1000 from our Federal to our State Account and report the transaction
    in our June 2005 report."'
